import React, {Component, FC, PropsWithChildren} from "react";
import { Route } from 'react-router-dom';
import Leftbar from '../components/Leftbar';

interface Props {
  title: string,
  path: string,
  element: React.ReactElement,
  children?: React.ReactElement,
  exact?: boolean,
}

export const LayoutRoute:  FC<PropsWithChildren<Props>>  = ({ title, children, ...props })=> {

  return (
    <Route {...props}>
      <div>
        <Leftbar />
        {children}
      </div>
    </Route>
  )
}

export const BaseRoute:  FC<PropsWithChildren<Props>>  = ({ title, children, ...props } : {title: string, children: any}) => {

  return (
    <Route {...props}>
      {children}
    </Route>
  )
}
